                                           value=\"{{ user.id }}\"
                                           name='users[]'>
                                    <label class=\"form-check-label\" for=\"user-{{ user.id }}\">
                                        {{ user.firstName }} {{ user.lastName }} - {{ user.id }}
                                    </label>
                                </div>
                            {% endfor %}
                        {% endif %}
                    </div>

                    <div class=\"text-center\">
